) ENGINE=InnoDB AUTO_INCREMENT=1611 DEFAULT CHARSET=utf8;
delimiter ;;
CREATE TRIGGER `tri_update` AFTER UPDATE ON `equipment_info` FOR EACH ROW insert into log_number(model,name,depositPlace,oldNumber,newNumber,person) 
